import React from "react";
// import nav icons
import { BiHomeAlt, BiUser } from "react-icons/bi";
import { BsClipboardData, BiBriefcase, BsChatSquare, BsBriefcase } from "react-icons/bs";
import { Link } from "react-scroll";

const Nav = () => {
  return (
    <nav className="fixed bottom-2 lg:bottom-8 w-full overflow-hidden z-50">
      <div className="container mx-auto">
        <div className="w-full bg-black/20 h-[96px] backdrop-blur-2x1 rounded-full items-centermax-w-[460px] mx-auto px-5 flex justify-between text-2x1 text-white/50">
          <Link to="home" className="cursor-pointer w-[60px] h-[60px] flex items-center justify-center">
            <BiHomeAlt />
          </Link>
          <Link to="about" className="cursor-pointer w-[60px] h-[60px] flex items-center justify-center">
            <BiUser />
          </Link>
          <Link to="" className="cursor-pointer w-[60px] h-[60px] flex items-center justify-center">
            <BsClipboardData />
          </Link>
          <Link to="" className="cursor-pointer w-[60px] h-[60px] flex items-center justify-center">
            <BsBriefcase />
          </Link>

        </div>
      </div>
    </nav>
  );
};

export default Nav;
